import React, { useState } from 'react';
import '../styles/global.css';
import Header from '../components/header';
import Footer from '../components/footer';
import styles from '../styles/viewBucket.module.css'; // Import styles

const ViewBucket = () => {
  const [cartItems, setCartItems] = useState([
    {
      id: 1,
      title: "Ang Maligayang Kapaskuhan (Hardcover)",
      author: "Kenpachi",
      price: 500.4,
      quantity: 1,
    },
    {
      id: 2,
      title: "Ang Maligayang Kapaskuhan (Hardcover)",
      author: "Kenpachi",
      price: 500.4,
      quantity: 2,
    },
  ]);

  // Update quantity function
  const updateQuantity = (id, delta) => {
    setCartItems((items) =>
      items.map((item) =>
        item.id === id
          ? { ...item, quantity: Math.max(1, item.quantity + delta) }
          : item
      )
    );
  };

  // Remove item function
  const removeItem = (id) => {
    setCartItems((items) => items.filter((item) => item.id !== id));
  };

  // Calculate total
  const calculateTotal = () =>
    cartItems.reduce(
      (total, item) => total + item.price * item.quantity,
      0
    );

  return (
    <div>
      <Header />
      <main className={styles.viewBucketContainer}>
        <div className={styles.cartContainer}>
          <header className={styles.cartHeader}>
            <h1>Your Bucket</h1>
            <div className={styles.progressBar}>
              <span className={`${styles.step} ${styles.completed}`}>
                Bucket Checking
              </span>
              <span className={styles.step}>Payment</span>
              <span className={styles.step}>To Ship</span>
            </div>
          </header>

          <table className={styles.cartTable}>
            <thead>
              <tr>
                <th>Item</th>
                <th>Price</th>
                <th>Quantity</th>
                <th>Total</th>
                <th></th>
              </tr>
            </thead>
            <tbody>
              {cartItems.map((item) => (
                <tr key={item.id}>
                  <td>
                    <div className={styles.itemDetails}>
                      <div className={styles.itemImage}></div>
                      <div>
                        <h3>{item.title}</h3>
                        <p>{item.author}</p>
                      </div>
                    </div>
                  </td>
                  <td>₱{item.price.toFixed(2)}</td>
                  <td>
                    <div className={styles.quantityControls}>
                      <button
                        onClick={() => updateQuantity(item.id, -1)}
                      >
                        -
                      </button>
                      <span>{item.quantity}</span>
                      <button
                        onClick={() => updateQuantity(item.id, 1)}
                      >
                        +
                      </button>
                    </div>
                  </td>
                  <td>₱{(item.price * item.quantity).toFixed(2)}</td>
                  <td>
                    <button
                      className={styles.deleteBtn}
                      onClick={() => removeItem(item.id)}
                    >
                      Delete
                    </button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>

          <footer className={styles.cartFooter}>
            <h3>Total: ₱{calculateTotal().toFixed(2)}</h3>
          </footer>
        </div>
      </main>
      <Footer />
    </div>
  );
};

export default ViewBucket;
